import React from "react";
import { Routes, Route } from "react-router-dom";
import HomePage from "../pages/HomePage";
import MerchantFormPage from "../pages/MerchantFormPage"; // Importa la nueva p치gina
import ProtectedRoute from "./ProtectedRoute";

const ProtectedRoutes = () => {
  return (
    <Routes>
      {/* Ruta protegida para la p치gina principal */}
      <Route 
        path="/home" 
        element={
          <ProtectedRoute>
            <HomePage />
          </ProtectedRoute>
        } 
      />
      
      {/* Ruta protegida para la p치gina de formulario */}
      <Route 
        path="/merchant-form" 
        element={
          <ProtectedRoute>
            <MerchantFormPage />
          </ProtectedRoute>
        } 
      />
    </Routes>
  );
};

export default ProtectedRoutes;
